	add("inversion", "{\"term\":\"inversion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Compare Italian \u0027inversione\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the action of invertin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"being upside down, in an inverted stat\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"being in a reverse sequence, in an inverted stat\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The move of one pitch in an interval up or down an octave\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The reversal of an interval\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The reversal of the pitch contour\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The reversal of a pitch class succession, such as a contrapuntal line or melody\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The subtraction of pitch classes in a set from twelve, which maps intervals onto their complements with respect to 0, and preserves interval classes, symbolized IX (X being the transposition that is inverted\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"a segment of DNA in the context of a chromosome that is reversed in orientation relative to a reference karyotype or genom\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An increase of air temperature with increase in altitude (the ground being colder than the surrounding air). When an inversion exists, there are no convection currents and wind speeds are below 5 knots. The atmosphere is stable and normally is considered the most favorable state for ground release of chemical agents\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Deviation from standard word order by putting the predicate before the subject. It takes place in questions with auxiliary verbs and in normal, affirmative clauses beginning with a negative particle, for the purpose of emphasis\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"with an auxiliary verb) \u0027\u0027\u0027Inversion\u0027\u0027 takes place in the sentence \u0027Is she here?\u0027 \u0026amp;mdash; \u0027is\u0027, the predicate, is before \u0027she\u0027, the subject\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"for the purpose of emphasis) \u0027\u0027\u0027Inversion\u0027\u0027 takes place in the sentence \u0027Never have I done that.\u0027 \u0026amp;mdash; \u0027have\u0027, the predicate, is before \u0027I\u0027, the subject, due to \u0027never\u0027 being the first word of the sentence\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Question formation involves the phenomenon commonly known as subject-auxiliary \u0027\u0027inversion\u0027\u0027, a change in word order in which the auxiliary moves in front of the subject. \u0026lt;br\u0026gt;(a) Here we shall describe this phenomenon in terms of movement of the element under INFL into COMP position.\u0026lt;br\u0026gt;(b) According to this analysis, what looks like an exchanging of positions between the subject and auxiliary (or INFL element, in GB terms) is actually the movement of the INFL element past the subject position into COMP. \u0026lt;br\u0026gt;(c) INFL-to-COMP movement seems to be triggered by the presence of the [+WH] feature in COMP\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"An operation on a group analogous to negation\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"an outdated term for homosexuality, particularly popular in early psychoanalysis\", \"priority\":16}]}, \"synonyms\":{}}");

