	add("invoice", "{\"term\":\"invoice\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027envois\u0027 plural of \u0027envoi\u0027 from the verb \u0027envoyer\u0027 (send)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a bill; a commercial document issued by a seller to a buyer indicating the products, quantities and agreed prices for products or services that the seller has already provided the buyer with. An invoice indicates that, unless paid in advance, payment is due by the buyer to the seller, according to the agreed terms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The lot or set of goods as shipped or received\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The merchant receives a large \u0027\u0027invoice\u0027\u0027 of goods\", \"priority\":3}]}, \"synonyms\":{}}");

