	add("involution", "{\"term\":\"involution\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Latin \u0027involutio\u0027, from \u0027volvere\u0027 ‘to roll’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"entanglement; a spiralling inwards; intricac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027: ‘Gomez,’ said the mortician, ‘is an expert only on the \u0027\u0027involutions\u0027\u0027 of his own rectum.’ — Anthony Burgess, \u0027Enderby Outside\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An endofunction whose square is equal to the identity function; a function equal to its inverse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Alfred J. Menezes et al, \u0027Handbook of Applied Cryptography\u0027, CRC Press, page 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Involutions\u0027\u0027 have the property that they are their own inverses\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The regressive changes in the body occurring with old age\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A power: the result of raising one number to the power of another\", \"priority\":7}]}, \"synonyms\":{}}");

